import React from 'react';
import './App.css';

const images = 'https://image.tmdb.org/t/p/w500';

function reUsableComponent(props) {
	let info = props.info;
	return (
		<div className='movieContent'>
			{info.map((movie) => {
				return (
					<img
						key={movie.id}
						className='images'
						src={`${images}${movie.poster_path}`}
						alt='none'
					></img>
				);
			})}
		</div>
	);
}

export default reUsableComponent;
